text:
## KỸ NĂNG

- Xây dựng được tính cách cá nhân (độc lập, tự tin, sẵn sàng ra quyết định, sáng tạo, cách nghĩ mang tính phản biện, thích nghi môi trường mới, quản lý tài nguyên cá nhân, học và tự học, quản trị dự án…);
- Kỹ năng nhóm (thành lập nhóm, hoạt động trong nhóm, lãnh đạo nhóm, phát triển nhóm…);
- Khả năng giao tiếp (trình bày, đàm phán, phát triển các mối quan hệ xã hội,...);
- Sử dụng ngoại ngữ (phát triển toàn diện bốn kỹ năng Nghe - Nói - Đọc - Viết và khả năng sử dụng tốt các thuật ngữ chuyên ngành);
- Kỹ năng lãnh đạo (thái độ lãnh đạo, nhận biết các vấn đề, sự cố và nghịch lý, đề xuất và sáng tạo trong việc giải quyết các vấn đề, sự cố, xây dựng và dẫn dắt một tổ chức, lên kế hoạch và dẫn dắt dự án đến thành công,...)
- Tư duy khởi nghiệp (thành lập công ty, tổ chức công ty và quản trị, viết kế hoạch kinh doanh, tài chính công ty, hình thành ý tưởng sản phẩm, dịch vụ dựa trên công nghệ, sáng tạo trong sản phẩm/ dịch vụ,...)
